import React from "react";

const Recipe = ({title,calories,image, ingredients}) => {
    return (
        <div className="body">
        <div className="ManuCard">
            <h1>{title}</h1>
            <p>{calories}</p>
            <img src={image} alt={title}/>
            <ol>
                {ingredients.map(ingredient => (
                    <li>{ingredient.text}
                        <a href={ingredient.image}> Image</a>
                    </li>

                ))}
            </ol>
        </div>
        </div>
    )
}

export default Recipe;
